import Link from 'next/link'

const Header = () => {
    return (
        <header>
            <nav>
                <Link href='/'>
                    <a>Blog</a>
                </Link>
                <a href='http://jasonroundtree.info/' target="_blank">Personal Site</a>
            </nav>
            <style jsx>{`
                li {
                    list-style-type: none;
                }
                a {
                    text-decoration: none;
                }
            `}</style>
        </header>
    )
}

export default Header
